import "../styles/Maps.css";
import { useState, useEffect } from "react";
import mapImage from "../../client/images/Anime.jpg";
function Maps() {
  const [images, setImages] = useState(null);

  useEffect(() => {
    fetch("http://localhost:3000/test", {
      mode: "cors",
    })
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
        setImages(data);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  }, []);
  return (
    <div className="Map-container">
      <span>Games</span>
      <img src="../images/Anime.jpg" alt="Anime" />

      <div className="Maps">
        {images &&
          images.images.map((obj, index) => (
            <img key={index} src={`/images/${obj}`}></img>
          ))}
      </div>
    </div>
  );
}

export default Maps;
